data.value:
Tento příkaz bude proveden, jakmile acs.exe skončí, ale před načtením všech výsledkových json souborů.

Hodnoty pro nahrazení:
 [b][mono]{type}[/mono][/b] — typ závodu;
 [b][mono]{car}[/mono][/b] — název auta;
 [b][mono]{car.id}[/mono][/b] — ID auta;
 [b][mono]{track}[/mono][/b] — název trati;
 [b][mono]{track.id}[/mono][/b] — ID trati.

Potřebujete-li některé další hodnoty, kontaktujte nás prosím a my je přidáme.

Jako pracovní složka bude použita složka Assetto Corsa v Dokumentech.

